-- Create a table for Vet Clinic Database

-- Owner table 

CREATE TABLE Owners (
  owner_id int not null primary key,
  first_name varchar(50),
  last_name varchar(50), 
  phone_number varchar(50), 
  email varchar(50), 
  home_address varchar(50) 
);

CREATE TABLE Pets (
  pet_id int not null primary key,
  owner_id int foreign key references Owners(owner_id),
  pet_name varchar(50),
  species varchar(50), 
  breed varchar(50),
  date_of_birth date,
  gender varchar(50), 
  microchip_number varchar(50) 
); 

CREATE TABLE Vets (
  vet_id int not null primary key,
  first_name varchar(50), 
  last_name varchar(50),
  speciality varchar(50), 
  phone_number varchar(50),
  hire_date date
);

CREATE TABLE Appointments (
  appointment_id int not null primary key,
  pet_id int foreign key references Pets(pet_id),
  vet_id int foreign key references Vets(vet_id), 
  date_time datetime, 
  reason varchar(500) 
);

CREATE TABLE Medical_Records (
  record_id int not null primary key,
  appointment_id int foreign key references Appointments(appointment_id),
  diagnosis varchar(500), 
  treatment varchar(500), 
  notes varchar(500), 
  billing_amount decimal 
);

CREATE TABLE Prescription (
  prescription_id int not null primary key,
  record_id int foreign key references Medical_Records(record_id),
  item_name varchar(50), 
  quantity int, 
  unit_price decimal, 
  instruction varchar(500) 
); 

